    const [showLogin, setShowLogin] = useState(false);

    const whichForm = () => {
    if(!showLogin){
      return(
        <SignUp newJWT={newJWT} authSwitch={authSwitch} />
      );
    } else {
      return(
        <SignIn newJWT={newJWT} authSwitch={authSwitch} />
      );
    }
}

    return <>{whichForm()}</>
}


export default Auth
